INSERT INTO soundseeker.politica (id, titulo, descripcion, imagen) VALUES (1, 'Política de Cancelación', 'Entendemos que los planes pueden cambiar. Ofrecemos la flexibilidad de cancelar tu reserva con un preaviso mínimo de 24hs para obtener un reembolso completo. Después de este período, se aplicará una tarifa de cancelación del 35% del costo total del alquiler. Nos esforzamos por brindar opciones flexibles para adaptarnos a tus necesidades, pero te pedimos que nos notifiques con anticipación para garantizar un servicio eficiente.', '/img/polit/cancelacion.svg');
INSERT INTO soundseeker.politica (id, titulo, descripcion, imagen) VALUES (2, 'Política de Higiene', 'La salud y seguridad de nuestros clientes son prioritarias. Todos los instrumentos pasan por un riguroso proceso de desinfección y limpieza antes y después de cada alquiler. Garantizamos un ambiente higiénico para que puedas disfrutar de tu experiencia musical con total tranquilidad. Además, proporcionamos detalles sobre nuestros procedimientos de limpieza para tu tranquilidad y confianza.', '/img/polit/higiene.svg');
INSERT INTO soundseeker.politica (id, titulo, descripcion, imagen) VALUES (3, 'Política Legal', 'Nos comprometemos a operar dentro de los límites legales establecidos. Al alquilar un instrumento, aceptas cumplir con todas las leyes y regulaciones aplicables. Cualquier uso indebido o ilegal resultará en la terminación inmediata del contrato y puede estar sujeto a acciones legales. Para más detalles sobre nuestras prácticas legales, no dudes en contactarnos.', '/img/polit/legal.svg');
INSERT INTO soundseeker.politica (id, titulo, descripcion, imagen) VALUES (4, 'Política de Devolución', 'Si por alguna razón no estás satisfecho con tu instrumento, ofrecemos un periodo de 24hs para devoluciones. Los artículos deben ser devueltos en el mismo estado en que fueron recibidos. Se aplicará una tarifa de reposición del 65% si se detectan daños significativos. Revisamos cuidadosamente cada artículo devuelto para garantizar la calidad y satisfacción del próximo cliente.', '/img/polit/devolucion.svg');
INSERT INTO soundseeker.politica (id, titulo, descripcion, imagen) VALUES (5, 'Política de Envío', 'Ofrecemos opciones de envío seguro y confiable para garantizar que recibas tu instrumento a tiempo y en perfecto estado. Los costos de envío variarán según la ubicación y la duración del alquiler. Te proporcionaremos toda la información necesaria para rastrear tu envío y estaremos disponibles para responder cualquier pregunta o inquietud que puedas tener durante el proceso.', '/img/polit/envio.svg');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (1, 'Explora el universo sonoro que te ofrecen nuestras guitarras y cuerdas en alquiler. Ya sea que anheles el dulce susurro de una guitarra acústica o la potencia estruendosa de un bajo eléctrico, tenemos el instrumento perfecto para ti. Sumérgete en la variedad, siente la emoción de probar diferentes modelos y encuentra tu compañero musical ideal.', '/img/cat/guitarras-y-cuerdas.webp', 1, 'Guitarras y Cuerdas');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (2, '¿Listo para descubrir el alma vibrante del acordeón? Nuestra colección en alquiler te invita a pasear por melodías que cuentan historias, desde valses nostálgicos hasta ritmos contagiosos de folk. Cada fuelle respira vida en tus composiciones, ofreciendo un abanico de sonidos que enamoran. Atrévete a desplegar su magia y añade un toque de autenticidad a tu música.', '/img/cat/acordeones.webp', 1, 'Acordeones');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (3, 'Deja que tus dedos se deslicen con gracia sobre las teclas de nuestros pianos en alquiler. Desde el imponente gran cola que emana elegancia hasta el práctico piano digital que fusiona modernidad y portabilidad, cada pulsación es una invitación a un viaje musical sin igual. Sumérgete en la riqueza de sonidos que solo un piano puede ofrecer. Inspírate, emociona y transforma tus emociones en melodías.', '/img/cat/pianos.webp', 1, 'Pianos');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (4, 'Siente el pulso de la música en tus venas con nuestra vibrante selección de instrumentos de percusión en alquiler. Desde la resonancia profunda de los timbales hasta la chispeante alegría de las maracas, cada golpe es un eco de tu espíritu aventurero. Atrévete a ser el corazón rítmico de tu banda, explorando texturas y cadencias que avivan la llama de cualquier composición.', '/img/cat/percusion.webp', 1, 'Percusión');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (5, 'Sumérgete en el mundo de posibilidades que los teclados en alquiler te ofrecen. Con variedad de sonidos y ritmos programables, cada tecla es una puerta a infinitos universos musicales. Desde el aspirante a maestro hasta el teclista veterano, hay un modelo esperando para elevar tu creatividad. Compactos, versátiles y listos para el escenario, nuestros teclados son la llave a una experiencia sonora sin límites.', '/img/cat/teclados.webp', 1, 'Teclados');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (6, 'Sumérgete desde el rock estruendoso hasta el jazz más sutil. Cada tarola, bombo y platillo está listo para traducir tu pasión en pulsaciones que capturan almas. Libera tu potencial rítmico, marca el compás que hará latir corazones y convierte cada actuación en una experiencia inolvidable. ¡Es hora de que hagas retumbar el mundo con tu talento!', '/img/cat/baterias.webp', 1, 'Baterías');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (7, 'Cada clarinete, saxofón y trompeta ha sido elegido para inspirar y elevar tu talento al infinito. Siente cómo el aire se convierte en música, cómo cada aliento se transforma en una melodía que habla al alma. Ya seas un virtuoso en busca de nuevos horizontes o un apasionado que se inicia en el arte, tenemos el soplo de inspiración que necesitas. ¡Deja que tu espíritu vuele y tu música fluya con nuestros vientos!', '/img/cat/vientos.webp', 1, 'Vientos');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (8, 'Adéntrate en la elegancia etérea de nuestros violines y violas. Desde el vibrante estremecimiento de las cuerdas hasta la cálida resonancia de la madera, cada instrumento es una obra de arte esperando ser tocada por tus manos. Cautiva corazones con la dulzura de una serenata o enciende pasiones con la intensidad de una sinfonía. Para el virtuoso o el estudiante, estos compañeros de cuerda son tus aliados en la vida.', '/img/cat/violines.webp', 1, 'Violines/Violas');
INSERT INTO soundseeker.categoria (id, descripcion, imagen, disponible, nombre) VALUES (9, 'Colección ecléctica de instrumentos musicales que no encajan fácilmente en categorías específicas, abarcando una diversidad de sonidos y estilos para satisfacer gustos variados y explorar nuevas dimensiones musicales.', '/img/cat/varios.webp', 1, 'Varios');
