INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 1, 1, 'Cort', 'Guitarra Eléctrica Cort CR100 CRS', 'La serie Classic Rock ofrece el aspecto, la sensación y el rendimiento de los instrumentos clásicos muy solicitados de la época dorada de las guitarras eléctricas. En el corazón de cada guitarra de la serie CR se encuentran las pastillas ClassicRocker especialmente diseñadas para brindar un sonido y respuesta auténticos de rock vintage.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 1, 2, 'Cort', 'Guitarra Eléctrica Cort G250 Negra', 'La Serie G representa una evolución lógica del término "vintage". Es moderno pero conserva las características familiares del diseño clásico de doble cutaway de una manera estéticamente elegante. Esta colección de doble cutaway incluye una amplia variedad de opciones y características para satisfacer mejor las necesidades y requerimientos específicos de un guitarrista. La G250 presenta una configuración humbucker de pastilla única que proporciona una amplia variedad de sonidos para cubrir prácticamente cualquier estilo musical.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 199.99, 1, 3, 'Valencia', 'Guitarra Electroacústica Valencia 4/4 / Cutaway / Negra', 'Una excelente primera guitarra clásica de cuerdas de nylon. El Valencia Series 100 es una guitarra de cuerdas de nylon con todas las funciones que es lo suficientemente asequible para cualquier guitarrista. La longitud de la escala del cuello te permite tocar con un verdadero estilo clásico, justo lo que necesita para desarrollar una técnica de toque adecuada.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 99.99, 1, 4, 'Kalani', 'Ukulele Kalani Concierto UK-23 TBL Aguamarina', 'El Ukelele es un instrumento musical de cuerda pulsada, similar a una guitarra de pequeño tamaño, originario de Hawái y popular en todo el mundo, el ukelele emite un sonido más cálido; es por eso que muchos iniciados prefieren tamaños de ukelele más pequeños, ya que estos conservan mejor ese tono brillante y exótico tan característico del ukelele.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 1, 5, 'Kalani', 'Bajo Eléctrico Cort Action-V Plus Rojo Translucido', 'El Ukelele es un instrumento musical de cuerda pulsada, similar a una guitarra de pequeño tamaño, originario de Hawái y popular en todo el mundo, el ukelele emite un sonido más cálido; es por eso que muchos iniciados prefieren tamaños de ukelele más pequeños, ya que estos conservan mejor ese tono brillante y exótico tan característico del ukelele.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1999.99, 2, 6, 'Hohner', 'Acordeón Hohner Corona III ADG Negro', 'El aire está lleno de música, risas y gente hablando —pero aun así se hace oír con claridad el característico sonido HOHNER. Especialmente, si se trata del Corona III, el más grande de la Serie Corona. El sonido voluminoso y estimulante encanta a la audiencia y al músico de igual manera, los invita a moverse, a bailar y a disfrutar. Una joya muy apreciada en vallenato, el norteño y el tex-mex, el Corona III es el acordeón perfecto para los músicos profesionales que están en la búsqueda de un sonido distintivo y poderoso, junto a características de longevidad y hermosa apariencia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1699.99, 2, 7, 'Hohner', 'Acordeón Hohner Corona III Besas Blanco', 'El aire está lleno de música, risas y gente hablando —pero aun así se hace oír con claridad el característico sonido HOHNER. Especialmente, si se trata del Corona III, el más grande de la Serie Corona. El sonido voluminoso y estimulante encanta a la audiencia y al músico de igual manera, los invita a moverse, a bailar y a disfrutar. Una joya muy apreciada en vallenato, el norteño y el tex-mex, el Corona III es el acordeón perfecto para los músicos profesionales que están en la búsqueda de un sonido distintivo y poderoso, junto a características de longevidad y hermosa apariencia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 699.99, 2, 8, 'Hohner', 'Acordeón Hohner Rey Vallenato ADG Naranja', 'El acordeón Hohner Rey Vallenato ADG naranja es un hermoso acordeón de 3 lengüetas para músicos principiantes y avanzados. Presentamos un instrumento específicamente diseñado para satisfacer los requisitos de la música del vallenato.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 2, 9, 'Hohner', 'Acordeón Hohner Bravo II 48 Bajos Rojo', 'El Acordeón Hohner Bravo II 48 Bajos Rojo puede ser el más pequeño de la serie Bravo, pero es tan poderoso como sus contrapartes más grandes. Un compañero perfecto especialmente diseñado para pequeños aprendices, el Bravo II 48 es su ingreso al mundo de los acordeones.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 99999.99, 3, 10, 'Kawai', 'Piano de Cola Kawai SK-7LA Ebony Polish con Silla', 'El SK-7 es una obra de arte trascendente que se comunicará con notable pasión, precisión y poesía de la mano del artista. Cuerdas de bajo enrolladas a mano por expertos artesanos. El proceso de enrollar alambre de cobre alrededor de las cuerdas del bajo requiere habilidades muy refinadas. En este proceso, los hábiles artesanos de KAWAI enrollan cada cable con cuidado y precisión a mano para garantizar la máxima calidad posible.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 3, 11, 'Medeli', 'Piano Digital Medeli CDP5200 Blanco', 'Con un toque moderno en mente, el diseño atrae a los entusiastas de piano de cualquier tipo, sin embargo, no destaca sólo por su apariencia, las 600 voces están muy bien diseñados para capturar la dinámica y los matices de un pianista.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 99999.99, 3, 12, 'Steinway & Sons', 'Piano de Cola Steinway & Sons Modelo D GRD Hamb Ebony', 'Este majestuoso instrumento musical — el pináculo de los pianos de cola de concierto- es la preferencia abrumadora de los mejores pianistas del mundo y de cualquiera que exija el más alto nivel de expresión musical. El modelo D llena la sala de potencia y calidez musical. Envíe su solicitud de un Steinway D aquí y nos pondremos en contacto con usted lo antes posible.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 9999.99, 3, 13, 'Pearl', 'Piano Vertical Pearl River EU118S Ebony Polish Sin Silla', 'Piano vertical de estudio clásico de 46,5″ con herrajes plateados • Serie europea.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 899.99, 3, 14, 'Yamaha', 'Piano Digital Yamaha P45 Con Adaptador PA-150', 'El piano digital Yamaha P-45 cuenta con un teclado de martillos graduados estándar (GHS). El tacto y la sensibilidad del teclado cambia gradualmente según el registro, de modo que la sensación es de mayor peso cuando se tocan partes graves y de más ligereza cuando se tocan partes agudas. El teclado del piano también tiene un tacto natural, con teclas negras con acabado mate que transmiten una experiencia de auténtico piano acústico al tocar.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 4, 15, 'Tycoon', 'Bongos Tycoon 7-8.1/2 30th Aniversario', 'Estos bongos únicos están construidos con madera de fresno americano de primera calidad seleccionada a mano con procedimientos especiales tomados en el proceso de producción para acentuar los patrones de la veta de la madera. Cuentan con un acabado mate oscuro único en su tipo con vetas de madera blanca.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 29.99, 4, 16, 'Tom Grasso', 'Pandero Tom Grasso de 6"', 'Instrumento de percusión pandereta en madera con 6 sonajeros y parche sintético.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 359.99, 4, 17, 'Tycoon', 'Bongos Tycoon 7-8.1/2 Artist', 'Ideal para percusionistas, sus aros son de lujo pintados en polvo negro, y con asas de afinación reforzadas. Estos tambores son perfectos para cualquier estilo de música, especialmente para grabaciones o toques en vivo.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 359.99, 4, 18, 'Jimbao', 'Bombo De Marcha Jimbao 18"', 'Este bombo es ideal para banda marcial, la marca líder en instrumentos de marcha, trae este increíble bombo de marcha de 18" y 12" de ancho. Este instrumento de gran calidad es perfecto para profesionales, la mejor elección que pueden realizar.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 5, 19, 'Roland', 'Teclado Arranger Roland E-X30', 'Los sonidos de piano de alta calidad en el E-X30 están perfectamente adecuados para el desarrollo de las habilidades musicales, donde siempre se requieren los sonidos y matices tradicionales. Yendo más allá, este teclado ofrece también sonidos alternativos integrados a bordo, incluyendo una variedad de sonidos étnicos para la interpretación de estilos de música locales en cualquier parte del mundo. Incluso la práctica a solas es inspiradora con el E-X30 — el arreglista integrado y la reproducción de audio MP3 te permiten interpretar junto con el acompañamiento musical completo, preparándote para tu primera experiencia de interpretación con banda u orquesta.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 899.99, 5, 20, 'Roland', 'Piano Digital Roland FP30X Negro', 'El FP-30X te ofrece el modelo más equilibrado de la serie FP-X de Roland. Este estilizado y elegante piano portátil, que combina un precio asequible con un rendimiento superior, toma como punto de partida el modelo básico FP-10 y le añade un generador de sonido mejorado, altavoces integrados más potentes y mayor polifonía.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 499.99, 5, 21, 'Kurzweil', 'Teclado Kurzweil KP-110 Blanco', 'Equipado con cientos de sonidos, incluido el Triple Strike Piano de Kurzweil (de las estaciones de trabajo de la serie PC3), un grabador de canciones de 6 pistas y más de 200 patrones de acompañamiento automático, el KP110 es un poderoso teclado portátil dirigido tanto para principiantes como un entusiastas de la música.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1999.99, 6, 22, 'Ludwig', 'Batería Ludwig Evolution Outfit 20" con Hard & ZBT Azul', 'Diseñado como un conjunto de batería intermedio, Ludwig Element Evolution es todo lo que un aspirante a baterista necesita para tener éxito. El equipo de la serie Evolution viene con hardware de doble refuerzo y platillos Zildjian ZBT* para que sea ideal para bateristas de cualquier edad que estén listos para dar el siguiente paso.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 799.99, 6, 23, 'Medeli', 'Batería Electrónica Medeli DD638DX', 'Batería electrónica Medeli DD638DX con redoblante en malla de 2 zonas para sonidos tipo rimshot, 3 toms de malla de 2 zonas y 2 platillos con function de choke, puedes parar su sonido con la mano, brindando realismo y musicalidad, Crash de 2 zonas y ride de 3 zonas, 1 Hi hat de 2 zona. Pad de bombo con pedal con posibilidad de ampliación a doble pedal. Cerebro avanzado con excelente desempeño.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 6, 24, 'Medeli', 'Batería Electrónica Portátil Medeli DD309', 'La batería portable Medeli DD309, es la mejor opción para aquellos que quieran aprender coordinación y ritmo al tocar batería, es sencilla de usar, transportable y no molesta a los vecinos.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 6, 25, 'Ludwig', 'Batería Accent Drive 5PC 22" Ludwig LC19511 Negra', 'Batería profesional de 5 tambores forrada de mica terminado brillantina, incluye herrajes, atril de hi-hats, 1 atril recto para platillo, atril de tarola, pedal de bombo y banco. Incluye juego de platillos Wuhan: hi-hats de 14 y crash-ride de 16".');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 399.99, 6, 26, 'Tom Grasso', 'Batería Para Niño Negra', 'Las baterías Tom Grasso se han caracterizado para el uso de personas aspirantes a la batería. Las baterías junior son específicamente para los niños. Si quieres entrar en el mundo de la batería esta batería es la ideal.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 999.99, 7, 27, 'Tom Grasso', 'Trompeta Pocket JBMT-500L', 'La Pocket JBMT - 500L, es una trompeta con más curvas que la convencional, puesto que es más pequeña, lo que hace fácil de transportar. Ofrece las mismas características en cuanto a sonoridad, afinación, facilidad al tocar de una trompeta estándar.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 7, 28, 'Leblanc', 'Clarinete SIB Leblanc CL651DIR', 'La historia de Leblanc se remonta a 1750 cuando Ets. D. Noblet se estableció en Francia haciendo instrumentos para la corte de Luis XV. Noblet ayudaría a establecer a Francia como el centro de la fabricación de instrumentos de viento de madera.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1399.99, 7, 29, 'Conn', 'Saxofón Alto Conn AS651DIR', 'El Conn AS651 es el instrumento perfecto para todos los estudiantes principiantes que quieran aprender a tocar el saxofón. El AS651 es duradero y resistirá el desgaste que los nuevos estudiantes harán. Además, la calidad del saxofón está muy por encima de su bajo precio, por lo que este es definitivamente el saxofón ideal para cualquier estudiante nuevo.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 799.99, 7, 30, 'Conn', 'Trombón Tenor Bach TB501', 'El Trombón TB501, es un Tenor de gran calibre, diseñado como alternativa entre los instrumentos de bajo y de alto calibre. Apto para estudiantes y músicos aficionados.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 8, 31, 'Verona', 'Violín 1/4 Solido Verona Inlaid Outfits', 'El Violín Verona es un instrumento hecho de madera solida, diseñado para estudiantes de nivel académico medio o iniciación para estudios formales. Incluye estuche semi rígido, tipo mochila, arco y colofonia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 8, 32, 'Verona', 'Violín 1/2 Sólido Verona Inlaid Outfits Mate', 'El Violín Verona es un instrumento hecho de madera solida, diseñado para estudiantes de nivel académico medio o iniciación para estudios formales. Incluye estuche semi rígido, tipo mochila, arco y colofonia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 8, 33, 'Verona', 'Violín 3/4 Sólido Verona Inlaid Outfits Mate', 'Cuando interpretas el Violín, estás acariciando musicalmente más de 300 años de historia. El violín 3/4 Inland Outfits Mate, es un instrumento que si le dedicas tu tiempo, paciencia y disciplina, te dará buenos resultados a futuro. Aprovecha al máximo y acércate a la música, vive una verdadera experiencia musical. El Violín Verona es un instrumento hecho de madera solida, diseñado para estudiantes de nivel académico medio o iniciación para estudios formales. Incluye estuche semi rígido, tipo mochila, arco y colofonia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (0, 499.99, 8, 34, 'Verona', 'Violín 4/4 Sólido Verona Inlaid Outfits Mate', 'El Violín Verona es un instrumento hecho de madera solida, diseñado para estudiantes de nivel académico medio o iniciación para estudios formales. Incluye estuche semi rígido, tipo mochila, arco y colofonia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 299.99, 1, 35, 'Cort', 'Guitarra Acústica Cort Classic AC100', 'Los modelos de AC de estilo tradicional se han rediseñado para mejorar la resonancia y lograr un auténtico sonido de guitarra clásica. La agradable combinación de maderas tonales produce un tono tradicional, profundo y deliciosamente melodioso. La serie Cort AC es muy tolerante con los errores de los estudiantes y requiere un poco menos de precisión y nitidez para lograr un buen tono. La AC100 cuenta con tapa de Abeto, parte posterior y laterales de Caoba, diapasón de Merbau.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 1, 36, 'Cort', 'Guitarra Eléctrica Cort Jazz Yorktown-BV', 'La serie sunset es una combinación de estilo retro con sensibilidad moderna y carácter sónico. Su pickguard de forma distintiva recuerda los estilos de diseño de guitarra de eras pasadas. Su sonido es cálido, rico y resonante, lo que le hace ideal para una variedad de géneros musicales.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 1, 37, 'Cort', 'Guitarra Electroacústica Cort SFX-DAO Natural', 'Como la visión de Cort de la electroacústica moderna, la serie SFX presenta la forma del cuerpo delgado de Cort (83 x 83 mm) con cutaway, moderno perfil de mástil en forma de V para una mejor ejecución y velocidad, parte trasera arqueada para una mejor resonancia, trastes jumbo y electrónicos.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 499.99, 1, 38, 'Cort', 'Guitarra Eléctrica Fender Squier Surf Pearl', 'La Serie Contemporánea Jazzmaster HH de Squier luce la apariencia de un Jazzmaster clásico, reforzado con pastillas de cerámica activas para satisfacer las necesidades de alto rendimiento de los sonidos modernos. Esta guitarra cuenta con un mástil delgado y rápido en forma de "C", con un radio de diapasón de 12" ideal para velocidad y curvas sin esfuerzo, y un puente ajustable con barra de parada proporcionando una maxima estabilidad de sintonización incluso en afinaciones de caída.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 599.99, 1, 39, 'Cort', 'Bajo Eléctrico Cort Walnut Action PJ Café', 'Asequibles pero cargados de materiales, componentes y artesanía de calidad, los bajos de la serie Action definen el valor para el aspirante a bajista con características versátiles como opciones de pastillas PJ, JJ y soapbar y electrónica de ecualización activa. Action PJ cuenta con un juego de pastillas PJ, la pastilla de bajo tipo P es ideal para géneros como el hard rock y el rock clásico, mientras que la pastilla tipo J es ideal para el jazz y el pop. Esta combinación proporciona una gran cantidad de sonidos de bajo clásicos para prácticamente cualquier género y estilo musical.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 599.99, 1, 40, 'Cort', 'Bajo Zurdo Cort Action LH Negro', 'El Cort Action Bass Plus LH se ha diseñado para que atraviese una línea de bajo tras otra con facilidad. Gracias a su cuerpo ergonómico y su fino mástil de arce, se desenvuelve sin esfuerzo por complejas líneas de bajo: ¡el slap, el ritmo y el funk nunca han sido tan fluidos! Y con un conjunto de pastillas Cort PJ que dan voz a un conjunto de tonos ricos y cálidos, puedes moldear la Action Plus para que se adapte prácticamente a cualquier género o estilo. Su ecualizador activo de dos bandas ofrece funciones de realce y recorte para frecuencias agudas y graves cuidadosamente seleccionadas, lo que facilita la selección del sonido preferido. El resultado es una amplia gama tonal con unos graves potentes y definidos y un realce suave. Completado con clavijas de fundición a presión y el puente de diseño EB6 de Cort, la entonación y la estabilidad de afinación son excepcionales. Con el Action Bass Plus has encontrado tu próximo caballo de batalla para conciertos y estudios.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 1, 41, 'Cort', 'Bajo Eléctrico Cort B4 Element Rojo Burgundy', 'Los Artisan B4 Element es el grupo de bajos completamente renovado que combina solo los mejores elementos de los muy populares bajos Artisan clase B, incluido el diapasón de Arce tostado en el mástil de 5 piezas de Panga-Panga / Nogal, pastillas Bartolini® MK-1, set de preamplificador Bartolini® MK- 1 y clavijas Hipshot® Ultralite. Recientemente se agregaron los nuevos puentes MetalCraft M4 de gran masa con sistema de carga de doble cuerda que mejora en gran medida la resonancia y la transferencia de tono, y un cuerpo de Caoba ergonómico más redondo con una tapa de Fresno bellamente decorada que viene en 3 opciones de color diferentes. La combinación de los elementos correctos, junto con la dedicación de Cort a la calidad, hace que el Artisan B4 Element sea una excelente opción para músicos profesionales y entusiastas por igual.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 99.99, 1, 42, 'Mahalo', 'Ukulele Mahalo Soprano U-Smile / Naranja', 'El Ukelele es un instrumento musical de cuerda pulsada, similar a una guitarra de pequeño tamaño, originario de Hawái y popular en todo el mundo, el ukelele emite un sonido más cálido; es por eso que muchos iniciados prefieren tamaños de ukelele más pequeños, ya que estos conservan mejor ese tono brillante y exótico tan característico del ukelele.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 299.99, 1, 43, 'Valencia', 'Guitarra Clásica Valencia 4/4 VC204TBU Azul', 'Fabricada según nuestros exigentes estándares, en nuestra propia fábrica en Indonesia, la Serie 200 comienza con una tapa de abeto sitka, cuerpo de nato y mástil de caoba para un tono equilibrado. Un distintivo acabado satinado transparente revela la belleza inherente de nuestras maderas tonales. Un diapasón de caoba ebonizada y un puente de caoba completan el aspecto elegante.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 1, 44, 'Fender', 'Guitarra Eléctrica Fender Squier Classic Vibe 70s', 'Una punta de sombrero para los modelos Strat de cabezal grande producidos en la década de 1970, la Stratocaster Classic Vibe \'70s crea un tono increíble por cortesía de un trío de pastillas de una sola bobina alnico diseñadas por Fender. Las características amigables para el jugador incluyen un perfil de cuello en forma de "C" delgado y cómodo con un diapasón de radio fácil de tocar de 9.5"y trastes estrechos y altos, así como un sistema de trémolo de estilo vintage para efectos expresivos de flexión de cuerdas. Este retroceso del modelo Squier también presenta marcas en el cabezal inspiradas en la década de 1970, herrajes niquelados de aspecto rico y un elegante acabado brillante de tinte vintage para un ambiente de la vieja escuela.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 2, 45, 'Hohner', 'Acordeón Hohner Bravo II 48 Bajos Azul', 'El Bravo II 48 puede ser el mas pequeño de la Serie Bravo, pero es tan poderoso como sus contrapartes mas grandes. Un acompañante ideal especialmente para los aprendices pequeños, el Bravo II 48 es tu entrada al mundo de los acordeones. La Serie Bravo de Hohner es el estándar para estudiantes y principiantes. Los rudos y musicalmente versátiles instrumentos en esta serie ofrecen calidad de desempeño disponible anteriormente solo en modelos considerablemente mas caros.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 2, 46, 'Hohner', 'Acordeón Hohner Bravo III 80 Bajos Rojo', 'El aire está lleno de música, risas y gente hablando —pero aun así se hace oír con claridad el característico sonido HOHNER. Especialmente, si se trata del Corona III, el más grande de la Serie Corona. El sonido voluminoso y estimulante encanta a la audiencia y al músico de igual manera, los invita a moverse, a bailar y a disfrutar. Una joya muy apreciada en vallenato, el norteño y el tex-mex, el Corona III es el acordeón perfecto para los músicos profesionales que están en la búsqueda de un sonido distintivo y poderoso, junto a características de longevidad y hermosa apariencia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 2, 47, 'Hohner', 'Acordeón Hohner Bravo III 80 Bajos Negro', 'El aire está lleno de música, risas y gente hablando —pero aun así se hace oír con claridad el característico sonido HOHNER. Especialmente, si se trata del Corona III, el más grande de la Serie Corona. El sonido voluminoso y estimulante encanta a la audiencia y al músico de igual manera, los invita a moverse, a bailar y a disfrutar. Una joya muy apreciada en vallenato, el norteño y el tex-mex, el Corona III es el acordeón perfecto para los músicos profesionales que están en la búsqueda de un sonido distintivo y poderoso, junto a características de longevidad y hermosa apariencia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 2, 48, 'Hohner', 'Acordeón Hohner Rey Vallenato GCF Negro', 'El acordeón Hohner Rey Vallenato GCF Negro es un hermoso acordeón de 3 lengüetas para músicos principiantes y avanzados. Presentamos un instrumento específicamente diseñado para satisfacer los requisitos de la música del vallenato.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 2, 49, 'Hohner', 'Acordeón Hohner Rey Vallenato Besas Amarillo', 'El aire está lleno de música, risas y gente hablando —pero aun así se hace oír con claridad el característico sonido HOHNER. Especialmente, si se trata del Corona III, el más grande de la Serie Corona. El sonido voluminoso y estimulante encanta a la audiencia y al músico de igual manera, los invita a moverse, a bailar y a disfrutar. Una joya muy apreciada en vallenato, el norteño y el tex-mex, el Corona III es el acordeón perfecto para los músicos profesionales que están en la búsqueda de un sonido distintivo y poderoso, junto a características de longevidad y hermosa apariencia.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 2, 50, 'Hohner', 'Acordeón Hohner Rey Vallenato ADG Rojo', 'El acordeón Hohner Rey Vallenato ADG rojo es un hermoso acordeón de 3 lengüetas para músicos principiantes y avanzados. Presentamos un instrumento específicamente diseñado para satisfacer los requisitos de la música del vallenato.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 899.99, 3, 51, 'Yamaha', 'Piano Digital Yamaha Arius YDP145 con Adaptador PA-150', 'El YDP-145 incorpora un teclado GHS de 88 teclas contrapesadas y las nuevas muestras del piano de cola CFX de Yamaha. Disfruta de su sonido realista gracias al modelado de resonancia virtual (VRM Lite), de las nuevas funciones que cuidan de tus oídos, y de la compatibilidad con la app Yamaha Smart Pianist.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 3, 52, 'Roland', 'Sintetizador Keytar Roland AX-Edge-B', 'El AX-Edge es el resultado de décadas de refinamiento que nos han permitido aprender de artistas del mundo entero sobre las mejores cualidades del sintetizador de directo definitivo. El AX-Edge tiene un diseño moderno y estilizado, con un aspecto personalizable mediante Edge Blades intercambiables.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1199.99, 3, 53, 'Kurzweil', 'Piano Digital Kurzweil M230 Rosewood Con Silla', '88 Teclas peso completo con acción graduada de martillo , teclado con sensibilidad ajustable. Presentando una variedad de pianos acústicos y eléctricos , órganos ,guitarra e instrumentos de orquesta. Maneja un panel de control de fácil acceso para las funciones que contiende el piano. Maneja los pedales de sustein, sostenuto y pedal suave. (128 Polifonías - 20 wats speakers).');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 3, 54, 'Yamaha', 'Piano Digital Yamaha DGX670 con Adaptador', 'El DGX-670 es un piano digital para disfrutar de todo, desde tocar el piano directamente hasta tocar junto con otros instrumentos. Además de la alta calidad del piano, los estilos de acompañamiento automático avanzados brindan respaldo en una amplia gama de géneros musicales, incluidos pop, R&B y jazz.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 3, 55, 'Medeli', 'Piano Digital Medeli DP460K', 'El DP460K está equipado con un procesador de polifonía de 256 notas que captura todas las notas de su interpretación, desde las cuatro manos que tocan en el modo Twin Piano hasta el pedaleo pesado cuando toca una pieza de Rachmaninoff. Toda la reproducción se puede grabar como un archivo de audio en la unidad externa USB para facilitar el acceso y compartir en la computadora. Una interfaz de audio USB permite que el piano se conecte a cualquier dispositivo móvil y se convierta en un reproductor de sistema estéreo completo. DP460K también proporciona un sonido rico y expresivo con un potente amplificador de 25 vatios, lo que permite que el jugador emerja rápidamente en los alrededores. Equipado con el nuevo teclado K8, el DP460K brinda un verdadero toque de piano con sus tapas de marfil, tres puntos de contacto con sensores que capturan la expresividad del jugador y un sistema de martillo especial que recrea la sensación de un piano acústico.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 359.99, 4, 56, 'Tycoon', 'Timbales Tycoon 14"-15" Cuerpo en Cromo', 'Calidad de sonido superior y autenticidad en el sonido diseñado para el timbalero profesional o avanzado. Acabado especialmente formulado de “Splashed Copper” diseñado para una máxima durabilidad sin sacrificar la calidad del sonido. Incluye soporte de timbal resistente, totalmente ajustable en altura, inclinable, soporte de montaje para cencerro con cencerro Tycoon TW-60, par de baquetas de timbal y llave de ajuste. Una excelente adición a la configuración de cualquier músico. Conchas disponibles en profundidad estándar (6.5" de altura) y en una configuración de carcasa de 14" y 15" de diámetro.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 4, 57, 'Tycoon', 'Timbales Tycoon Ralph Irizarry 14"-15"', 'Estos timbales han sido diseñados en colaboración con el maestro Ralph Irizarry, su calidad superior y autenticidad en el sonido lo hace especial para profesionales y músicos avanzados.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 299.99, 4, 58, 'Tycoon', 'Tumbadora Tycoon Master Platinum Tri-Fade Series', 'Construido con madera de roble Siam envejecida seleccionada a mano, que proporciona una durabilidad excepcional y un sonido inigualable. 30" de altura con barriga ancha para crear tonos graves ricos y profundos. Aros de lujo, placas laterales reforzadas con orejetas de afinación de 3/8" de diámetro.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 359.99, 4, 59, 'Tycoon', 'Tumbadora Tycoon Master Classic Series Natural MTC-130', 'Construido con madera de roble Siam envejecida seleccionada a mano, que proporciona una durabilidad excepcional y un sonido inigualable. 30" de altura con barriga ancha para crear tonos graves ricos y profundos. Aros de lujo, placas laterales reforzadas con orejetas de afinación de 3/8" de diámetro.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 299.99, 4, 60, 'Tycoon', 'Conga Compacta 11.75 Tycoon Tac-120 BC HC', 'Las Congas de Tycoon están diseñadas para introducir una dimensión completamente nueva de portabilidad nunca antes vista en nuestra línea de congas. Utilizando la misma construcción de casco Siam Oak con duelas que nuestras congas Master Series, las Congas miden solo 4-3/4" de altura y están equipados con parches Remo M7 para una máxima durabilidad y retención de afinación. ');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 359.99, 4, 61, 'Tycoon', 'Congas Tycoon Supremo 11-12 con Base', 'Ideal para estudiantes y fanáticos de la percusión, sus componentes lo hacen sólidamente construido y le dan un gran sonido. ');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 359.99, 4, 62, 'Tycoon', 'Congas Tycoon 10 11 Supr Natural Con Stand STC-B N/D', 'Ideal para Ideal para principiantes y entusiastas de la percusión. 28" de alto, construido con madera de roble Siam envejecida seleccionada a mano, que brinda una durabilidad excepcional y sonidos inigualables. Valor excepcional para un conjunto de gran sonido bien construido para congas de tamaño completo. Aros Deluxe con recubrimiento de polvo negro, placas laterales reforzadas con orejetas de afinación de 5/16" de diámetro. ');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 4, 63, 'Tycoon', 'Bongos 40th Anniversary Celebration Series Tycoon', 'La serie Tycoon Percussion 12" 40th Anniversary Celebration Series Djembe es una celebración tanto de la musicalidad como de la artesanía, que marca los 40 años de excelencia de Tycoon en la fabricación de percusión. Elaborado con una impecable atención al detalle, este djembe de 12 pulgadas está construido con materiales de primer nivel que no solo le dan una apariencia impresionante, sino que también contribuyen a su sonido rico y vibrante.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 199.99, 4, 64, 'Tycoon', 'Bongo Tycoon Concierto Series Green Spectrum TB-800C', 'Los bongos Tycoon Percussion Concerto Green Spectrum combinan materiales de primera calidad con un diseño meticuloso para crear un sonido superior que generará ondas rítmicas nítidas en cualquier aplicación musical, desde el escenario hasta el estudio y los círculos casuales de batería con amigos.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 39.99, 4, 65, 'Tycoon', 'Maracas Tycoon de Piel Vaca Natural TMSC-110', 'Maracas de piel de vaca natural con mangos de madera, con nuevo material de relleno especialmente diseñado para producir sonidos nítidos.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 39.99, 4, 66, 'Tycoon', 'Maracas Tycoon Cuero Crudo Round Natural TMS120', 'Maracas de cuero natural que proporcionan un sonido más completo. Mangos hechos de madera ecológica de Roble Siam Especialmente diseñados de un nuevo material para producir un sonidos nítidos.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 99.99, 4, 67, 'Tycoon', 'Güiro Merenguero Pequeño Tycoon', 'Proporciona la base rítmica de música de merengue o cumbia. Diseñado para dar un sonido durable.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 109.99, 4, 68, 'Tycoon', 'Güiro Merenguero Grande Tycoon', 'Proporciona la base rítmica de música de merengue o cumbia. Diseñado para dar un sonido durable.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 499.99, 4, 69, 'Ludwig', 'Redoblante Ludwig Metal Black Magic', 'Nada suena como una caja de latón. La dinámica, la sensibilidad y la proyección de Brass son insuperables. El Ludwig Black Magic presta la construcción de níquel sobre latón negro con cuentas de Black Beauty, para una apariencia tan impresionante como su tono. A diferencia de las Black Beautys tradicionales, que vienen con aros con bridas, la Ludwig Black Magic viene con aros fundidos a presión para un ataque seco y nítido bajo micrófonos cercanos. El resultado es un tono decididamente más moderno que el baterista de hoy disfrutará.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 199.99, 4, 70, 'Tycoon', 'Redoblante Tom Grasso 14"X3.5" Abedul', 'Redoblante en madera de abedul 14" x 3.5". Lacado rojo. Incluye baquetas y llave de afinación. 8 tensores.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 99.99, 4, 71, 'LP', 'Campana Para Timbal LP LP322 Cromado Antiguo', 'Los poderosos y medios matices producidos por esta campana son tan únicos como el mismo "El Rey del Timbal". El Tito Puente Signature Cowbell está hecho en los EE. UU. Y tiene un cáncamo auto-alineador patentado por LP que se ajusta a varillas de 3/8" a 1/2" de diámetro.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 7, 72, 'Tom Grasso', 'Clarinete SIB JBCL-540', 'Clarinete de estudio Bb de baquelita, 18 teclas, color negro satinado, almohadillas italianas, boquilla y estuche de ABS incluidos.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 699.99, 7, 73, 'Leblanc', 'Clarinete 17 Llaves SIB Leblanc CL501', 'El clarinete en madera de granadilla CL501, es hermoso modelo de estudio.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1199.99, 7, 74, 'Tom Grasso', 'Trompeta JBTR-410L', 'Trompeta escala Sib, escala: 11,66 mm, campana: 125 mm, tubo de afinación: cobre-níquel, revestimiento: barniz, plata, níquel.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1499.99, 7, 75, 'Bach', 'Trompeta para Estudiante Bach TR500DIR', 'Los instrumentos Bach Aristocrat son presentados por Conn-Selmer, el mayor fabricante estadounidense de instrumentos de banda. Aristocrat representa una línea premium de instrumentos musicales de calidad a precios razonables para los jóvenes jugadores de hoy en día que se fabrican según nuestras especificaciones exactas. Respaldados por garantías y servicios completos, los instrumentos de Aristocrat son adecuados para jugadores de todas las edades.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1199.99, 7, 76, 'Bach', 'Trompeta para Estudiante Bach TR650', 'La Trompeta lacada Selmer-Bach TR650 es un instrumento para estudiantes. Sus características la hacen un instrumento muy versátil y práctico también para iniciación musical, Sus pistones están construidos en acero inoxidable para mayor duración y disminuir su mantenimiento, Posee anillo pulgar en primera bomba y anillo de afinación en tercera bomba.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1699.99, 7, 77, 'Conn-Selmer', 'Saxofón Alto Conn AS650', 'Hoy, CG Conn establece el estándar para instrumentos de latón de alta calidad. La larga y exitosa historia de la fabricación ha crecido, impulsada por la pasión y el amor a la música. ¡Toca y lo oirás!');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 599.99, 7, 78, 'Tom Grasso', 'Saxofón Soprano JBSST-400L', 'Este es un instrumento con un rango de una octava por encima del saxofón alto. Aunque es un instrumento difícil de tocar porque es fabricado solo por un número limitado de fabricantes, Tom Grasso ha revisado la disposición de las teclas y el diseño del tubo para lograr una disposición de teclas natural y una sensación de tocar.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1899.99, 7, 79, 'Conn-Selmer', 'Saxofón Soprano SC650', 'Lo que hace que el saxo soprano curvo Conn SC650 se destaque de otros instrumentos de precio similar son los Pisoni pads. Estos italianos pads proporcionan un sello excepcional que ayuda a la producción tuning y a la toma de notas - una excelente ventaja para cualquier estudiante.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1299.99, 7, 80, 'Bach', 'Trombón Tenor Sib/DO Bach B650DIR', 'El trombón TB650, es un tenor de gran calibre, diseñado como alternativa entre los instrumentos de bajo y de alto calibre. Apto para estudiantes y músicos aficionados.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1299.99, 7, 81, 'Bach', 'Trombón Tenor JBSL-700L', 'El Trombón JBSL - 700L, es un Tenor de gran calibre, diseñado como alternativa entre los instrumentos de bajo y de alto calibre. Apto para estudiantes y músicos aficionados. ');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 499.99, 7, 82, 'Tom Grasso', 'Flauta Traversa con Sistema Cerrado', 'La Flauta Traversa JBFL-6238S, es de sistema cerrado y está elaborada en níquel, sus acabados la hacen visualmente elegante. Ha sido diseñada para principiantes, aunque ofrece todas las características de una Flauta de nivel avanzado, proporcionando una respuesta rápida, sonido pastoso y nítido, carácter tonal, afinación exacta y flexibilidad.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 7, 83, 'Armstrong', 'Flauta Traversa con Sistema Cerrado Armstrong', 'Durante más de 75 años, las flautas de Armstrong han sido la encarnación de la confiabilidad. Los maestros y músicos de todo el mundo siguen recomendando las flautas de Armstrong.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1399.99, 7, 84, 'Armstrong', 'Flauta Traversa con Sistema Abierto Armstrong', 'Durante más de 75 años, las flautas de Armstrong han sido la encarnación de la confiabilidad. Los maestros y músicos de todo el mundo siguen recomendando las flautas de Armstrong.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 99.99, 7, 85, 'Jimbao', 'Corneta Plateada JBN1N Jimbao', 'Un excelente instrumento en afinación Bb y acabado plateado.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 199.99, 7, 86, 'Jimbao', 'Corneta Doradas JBBC-1600 L Jimbao', 'Cuerno de caza, Acción Sib, Campana: 146mm, Material: latón, Chapado: barniz, plata, níquel.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 49.99, 7, 87, 'Hohner', 'Melódica Fire Hohner C9432174 Red-Black (9432/32)', 'Desde el funk hasta el reggaeton, los ritmos calientes son una parte importante de la experiencia. Los conjuntos funky condicen con los ritmos apasionados, el baile rápido y las bebidas divertidas. Por supuesto, la melódica no puede solo brindar el telón de fondo con sonido perfecto, también tiene que lucir adecuada para la situación. Con la Fire Melódica, hemos dado a nuestra melódica un nuevo aspecto que volará sus cabezas. Teclas negras y rojas y un cuerpo rojo y brillante con una estructura robusta, hermética y el sonido típico de la melódica. ¡Un diseño robusto para un instrumento caliente!');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 599.99, 8, 88, 'Verona', 'Violín 4/4 Sólido Verona HXTQ09FRO Natural', 'El Violín Verona es un instrumento hecho de madera solida, diseñado para estudiantes de nivel académico medio o iniciación para estudios formales.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1299.99, 8, 89, 'Gliga', 'Violín 4/4 Gliga Gems I Genova AG-V044-A', 'Estudiante avanzado violín Genova AG-V044-A tamaño 4/4. El instrumento está hecho de arce moderadamente ondulado. Hermoso diseño, acabado antiguo. El violín está hecho según el modelo Stradivari. La caja de resonancia superior, klets y esquinas del macizo del abeto resonante de los Cárpatos. La cubierta inferior y los lados están hechos de arce de los Cárpatos con ondulación. Diapasón de ébano. Clavijas, fuelle, botón y mentonera en arce ondulado.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 399.99, 8, 90, 'Verona', 'Viola 16.5 Sólida Inland Verona', 'La Viola Verona , es un bello instrumento, diseñado bajo estrictos estándares de calidad, lo que le otorga un sonido dulce y agudo, es fácil de usar y ideal para estudiantes y principiantes.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 999.99, 8, 91, 'Gliga', 'Viola 16,5" Gliga Genial II B-V165', 'Este es un instrumento modelo Stradivari hecho a mano. La tapa del alto está hecha de abeto macizo, mientras que la base y los aros están hechos de arce. La cubierta inferior consta de dos partes. El mástil está hecho de arce, mientras que el mástil, el mástil, la mentonera y las clavijas están hechas de ébano (ébano). El instrumento está lacado con nitrocelulosa, lo que permite que la madera resuene libremente. La madera del instrumento proviene de las montañas de los Cárpatos y se seca durante varios años para garantizar una calidad de sonido óptima.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 1199.99, 8, 92, 'Verona', 'Contrabajo 4/4 Laminado Verona', 'El Contrabajo Verona es un hermoso instrumento con excelentes acabados y un peso es moderado.');
INSERT INTO soundseeker.producto (disponible, precio, categoria_id, id, marca, nombre, descripcion) VALUES (1, 599.99, 8, 93, 'Verona', 'Chelo 1/4 Laminado Verona', 'El chelo es un instrumento musical de cuerda frotada, perteneciente a la familia del violín y de tamaño y registro entre la viola y el contrabajo. Su afinación corresponde a una octava más grave que la de la viola. Su tono es rico y sonoro, sus cuerdas altas tienen una cualidad melódica inconfundible.');
